import React from 'react'
import './Footer.css'

const Footer = () => {
  return (
      <div>
          <div className='row' id="footer-row">
              <h3 id="footer-header">SunnySide</h3>
              <span className='foot'>About</span>
              
          </div>
    </div>
  )
}

export default Footer
